# Process files
if uploaded_files:
    with st.spinner("Processing files..."):
        all_images = []
        
        for uploaded_file in uploaded_files:
            file_ext = Path(uploaded_file.name).suffix.lower()
            
            try:
                if file_ext == '.pdf':
                    images = process_pdf(uploaded_file)
                    all_images.extend(images)
                elif file_ext in ['.cbz', '.zip']:
                    images = process_zip(uploaded_file)
                    all_images.extend(images)
                elif file_ext in ['.png', '.jpg', '.jpeg', '.gif', '.webp']:
                    images = process_image(uploaded_file)
                    all_images.extend(images)
            except Exception as e:
                st.error(f"Error processing {uploaded_file.name}: {str(e)}")
        
        if all_images:
            st.success(f"Loaded {len(all_images)} pages successfully!")
            
            html_content = create_manga_reader_html(all_images, view_mode, auto_scroll_speed)
            components.html(html_content, height=800, scrolling=False)
        else:
            st.warning("No valid images found in the uploaded files.")
